import collections

def count_accessible_rolls(diagram_input):
    # Parse this shit into a grid (list of lists of characters <3)
    grid = [list(line) for line in diagram_input.strip().split('\n')]
    if not grid or not grid[0]:
        print("Error: The input diagram is empty or malformed.")
        return 0

    rows = len(grid)
    cols = len(grid[0])
    accessible_count = 0

    # The 8 possible directional offsets for neighbors (including diagonals)
    # (dr, dc): (row change, col change)
    neighbor_offsets = [
        (-1, -1), (-1, 0), (-1, 1),  # Top row
        ( 0, -1),          ( 0, 1),  # Middle row
        ( 1, -1), ( 1, 0), ( 1, 1)   # Bottom row
    ]

    # Iterate through that shit in the grid
    for r in range(rows):
        for c in range(cols):
            # We only care about cells that contain a paper roll
            if grid[r][c] == '@':
                adjacent_rolls = 0

                # Check on the neighbors
                for dr, dc in neighbor_offsets:
                    nr, nc = r + dr, c + dc

                    # Check if the neighbor coordinates are within the grid bounds
                    if 0 <= nr < rows and 0 <= nc < cols:
                        if grid[nr][nc] == '@':
                            adjacent_rolls += 1

                # Determine if you can access the roll
                # A roll is accessible if it has fewer than four adjacent rolls
                if adjacent_rolls < 4:
                    accessible_count += 1
                    # grid[r][c] = 'x'

    # print("\n--- Visualized Accessible Rolls ---")
    # for row in grid:
    #     print("".join(row))
    # print("-----------------------------------")

    return accessible_count

